import React from "react"; 

const App = () => {
    return (
        <div className="calculator">
            <h1>React Calculator</h1>
            <div id="n1">Num1</div>
            <div id="n2">Num2</div>
            <div id="inner-box">
                <div className="sign">+</div>
                <div className="sign">-</div>
                <div className="sign">*</div>
                <div className="sign">/</div>
            </div>
        </div>
    );
}

export default App;
